import React from "react";
import { Link } from "react-router-dom";

function ProductsPage() {
  return (
    <>
      <h1>The Products Page</h1>
      <ul>
        <li>
          <Link>Prod 1</Link>
        </li>
        <li>Prod 2</li>
        <li>Prod 3</li>
      </ul>
    </>
  );
}

export default ProductsPage;
